import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";

import arcade from "../images/arcade.png";
import calcetto from "../images/calcetto.png";
import coding from "../images/coding.png";
import furnace from "../images/furnace.png";
import grill from "../images/grill.png";
import party from "../images/party.png";
import meeting from "../images/meeting.png";
import pingpong from "../images/pingpong.png";

const Cards = (props) => {
    const arrayImages = [
        {id: 0, img: arcade},
        {id: 1, img: calcetto},
        {id: 2, img: coding},
        {id: 3, img: furnace},
        {id: 4, img: grill},
        {id: 5, img: party},
        {id: 6, img: meeting},
        {id: 7, img: pingpong},
    ]

    return ( 
        <> 
        <Card key={0}>{arrayImages.img}</Card>
        <Card key={1}>{arrayImages.img}</Card> 
        <Card key={2}>{arrayImages.img}</Card> 
        <Card key={3}>{arrayImages.img}</Card> 
        <Card key={4}>{arrayImages.img}</Card> 
        <Card key={5}>{arrayImages.img}</Card> 
        <Card key={6}>{arrayImages.img}</Card> 
        <Card key={7}>{arrayImages.img}</Card> 
        </>
     );
}
 
export default Cards;
